import Topo from "./componentes/Topo";
import EspacoBotoes from "./componentes/EspacoBotoes";
import EspacoJogos from "./componentes/EspacoJogos";

function App() {

  const Jogos = [
    {
        titulo: '2831293812093',
        texto1: 'sdasdsad',
        texto2: 'dasdasdasda',
        imagem1: './imagens/grazinha.png',
        imagem2: './imagens/grazinha.png'
    },
    {
      titulo: '12462163',
      texto1: 'sdasdsad',
      texto2: 'dasdasdasda',
      imagem1: './imagens/grazinha.png',
      imagem2: './imagens/grazinha.png'
    }
]

  return (
    <div className="App">
      <Topo/>
      <EspacoBotoes />

      {Jogos.map(jogo => 
      <EspacoJogos 
      key={jogo.titulo} 
      titulo={jogo.titulo} 
      texto1={jogo.texto1} 
      texto2={jogo.texto2} 
      imagem1={jogo.imagem1} 
      imagem2={jogo.imagem2}
      />)}
    </div>
  );
}

export default App;
